// src/pages/dashboard.jsx
import React, { useEffect, useState } from "react";
import { useLocation, useNavigate, Link } from "react-router-dom";
import API from "../services/api";
import { useAuth } from "../context/AuthContext";
import {
  RiBankLine,
  RiMoneyDollarCircleLine,
  RiFileListLine,
  RiShieldCheckLine,
  RiBankCardLine,
  RiLogoutBoxRLine,
  RiHomeLine,
} from "react-icons/ri";

export default function Dashboard() {
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);
  const location = useLocation();
  const navigate = useNavigate();
  const { logout } = useAuth();
  const fromKyc = location.state?.fromKyc;

  useEffect(() => {
    let mounted = true;
    (async () => {
      try {
        const res = await API.get("/auth/me"); // adjust path if necessary
        if (!mounted) return;
        setProfile(res.data);
      } catch (err) {
        console.warn("Could not load profile:", err?.response?.data || err.message);
      } finally {
        if (mounted) setLoading(false);
      }
    })();
    return () => (mounted = false);
  }, []);

  const handleLogout = () => {
    logout();
    navigate("/"); // send to landing/home
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <header className="w-full bg-[#0b3d91] text-white shadow-md py-4 px-6 flex items-center justify-between">
        <div>
          <div className="text-xs">Welcome</div>
          <div className="text-lg font-semibold">{profile?.name || profile?.email || "Customer"}</div>
          <div className="text-xs opacity-80">{profile?.kycStatus ? `KYC: ${profile.kycStatus}` : ""}</div>
        </div>

        <div className="flex items-center gap-3">
          <Link to="/" className="px-3 py-2 rounded-md bg-white/10 hover:bg-white/20 inline-flex items-center gap-2">
            <RiHomeLine /> Home
          </Link>

          <button onClick={handleLogout} className="px-3 py-2 rounded-md bg-red-600 hover:bg-red-700 inline-flex items-center gap-2">
            <RiLogoutBoxRLine /> Logout
          </button>
        </div>
      </header>

      <main className="max-w-6xl mx-auto px-6 py-8">
        {fromKyc && (
          <div className="mb-6 bg-green-50 border border-green-100 p-4 rounded-md">
            <strong>沁 KYC Submitted!</strong> Your KYC is under verification. You can access your account features below.
          </div>
        )}

        <section className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          <div className="lg:col-span-2 bg-white rounded-lg p-6 shadow-sm">
            <div className="text-sm text-slate-500">Account Number</div>
            <div className="text-2xl font-bold mt-1">{profile?.accountNo || "Not assigned"}</div>
            <div className="mt-3 text-sm text-slate-600">Available Balance: {profile?.balance ?? "窶能

map:
