          <h3 className="text-lg font-semibold mb-4">Quick Actions</h3>
          <div className="grid grid-cols-2 sm:grid-cols-4 gap-4">
            <ActionCard icon={<RiBankLine />} title="Accounts" />
            <ActionCard icon={<RiMoneyDollarCircleLine />} title="Deposits" />
            <ActionCard icon={<RiShieldCheckLine />} title="Insurance" />
            <ActionCard icon={<RiBankCardLine />} title="Cards" />
          </div>
        </section>
      </main>
    </div>
  );
}

function ActionCard({ icon, title }) {
  return (
    <div className="bg-white p-4 rounded-md shadow-sm text-center cursor-pointer hover:shadow-md">
      <div className="text-2xl text-[#0b3d91] mb-2">{icon}</div>
      <div className="font-semibold">{title}</div>
    </div>
  );
}
